import React, { Component } from 'react'

import cover from '../cover.jpg'
import YoutubeFooter from '../Components/YoutubeFooter';
import Footer from '../Components/Footer';



export default class Home extends Component {

    render() {
        return (
            <div style = {{}}>
                <img style = {{width: '100%', verticalAlign: 'middle'}} src = {cover} alt="cover photo"/>

                <div style = {{position: 'relative', top: -281}}>
                    <FeaturedTrack/>
                    <div class = "Background-Color-Black" style = {{height: '700px', padding: 20}}>
                        <h3 style = {{color: 'white'}}>Songs</h3>
                    </div>
                </div>

                <YoutubeFooter 
                    title = "Goodbye" 
                    author = "Post Malone"
                    url = "https://www.youtube.com/watch?v=ba7mB8oueCY"/>
                <Footer/>
            </div>
          );
    }
}

const FeaturedTrack = () => {
    return (
        <div style = {{display: 'flex', flexDirection: 'row'}}>
            <img style = {{width: 250, verticalAlign: 'middle'}} src = {'https://img.youtube.com/vi/7Auf9rBvNbY/0.jpg'} alt="cover photo"/>
            <div style = {{display: 'flex', flexDirection: 'column', flex: 1}}>
                <div style = {{height: 94}}>
                </div>
                <div class = "Background-Color-Maroon" style = {{height: 94, padding: 10}}>
                    <h6 style = {{color: 'white'}}>Featured Track</h6>
                    <h4 style = {{color: 'white', padding: 0, margin: 0}}>Upbringing</h4>
                </div>
            </div>
        </div>
    )
}
